/* ====== Sidebery Â· Atom One Dark ====== */
#root.root {
  /* layout */
  --tabs-indent: 0px;
  --general-border-radius: 8px;
  --tabs-height: 32px;
  --tabs-margin: 6px;
  --pinned-tabs-col: 4;

  /* Atom One Dark palette */
  --atom-text:      #ABB2BF;
  --atom-subtext1:  #9DA5B4;
  --atom-subtext0:  #8B93A2;
  --atom-overlay1:  #6B717D;
  --atom-surface2:  #4B5263;
  --atom-surface1:  #3E4451;
  --atom-surface0:  #2C313C;
  --atom-base:      #282C34;
  --atom-mantle:    #21252B;
  --atom-crust:     #1B1D23;

  /* accents */
  --atom-blue:    #61AFEF;
  --atom-cyan:    #56B6C2;
  --atom-green:   #98C379;
  --atom-orange:  #D19A66;
  --atom-red:     #E06C75;
  --atom-purple:  #C678DD;

  --accent: var(--atom-blue);

  /* mappings */
  --toolbar-bg: var(--atom-mantle);
  --frame-bg:   var(--atom-base);

  --tabs-normal-fg: var(--atom-subtext1);
  --tabs-active-fg: var(--atom-text);
  --tabs-muted-fg:  var(--atom-overlay1);

  /* === VERY THIN SIDEBERY OUTLINE (ONLY CHANGE) === */
  border-right: 1px solid rgba(255, 255, 255, 0.12);
}

/* ================= NAVIGATION BAR ================= */
.NavigationBar {
  background: linear-gradient(
    180deg,
    var(--toolbar-bg) 0%,
    var(--frame-bg) 100%
  );
  border-bottom: 1px solid var(--atom-surface1);
  transition: ease-in-out 200ms;
}

/* Center nav items */
.NavigationBar .main-items {
  justify-content: center;
}

/* Inline layout */
.NavigationBar[data-layout="inline"] .main-items .nav-item {
  flex-grow: 1;
  max-width: 66px;
  color: var(--tabs-normal-fg);
  position: relative !important;
  transform: translateX(0) !important;
}

.NavigationBar[data-layout="inline"]
.main-items
.nav-item[data-active="false"] {
  display: none;
}

/* Bottom bar */
.BottomBar {
  display: none;
}

/* Tabs base */
.Tab {
  min-width: 33px;
  border: 0 !important;
  transition: ease-in-out 200ms;
}

/* Hide text/icons by default */
.Tab .title,
.Tab .audio {
  opacity: 0 !important;
  transition: ease-in-out 250ms;
}

/* Favicons */
.Tab[data-pin="true"] .fav,
.Tab[data-pin="true"] .fav-icon {
  width: 20px;
  height: 20px;
}

.Tab[data-pin="false"] .fav,
.Tab[data-pin="false"] .fav-icon {
  width: 18px;
  height: 18px;
}

/* ================= ACTIVE TAB STYLING ================= */

/* Active non-pinned tab */
.Tab[data-pin="false"][data-active="true"] .body {
  background: rgba(255, 255, 255, 0.06);
  border-radius: var(--general-border-radius);
  outline: 1px solid rgba(255, 255, 255, 0.14);
  box-shadow: 0 0 12px rgba(0, 0, 0, 0.35);
}

/* Active pinned tab */
.Tab[data-pin="true"][data-active="true"] .color-layer {
  background: rgba(255, 255, 255, 0.05) !important;
  outline: 1px solid rgba(255, 255, 255, 0.14);
  border-radius: var(--general-border-radius);
}

/* Non-active tabs */
.Tab[data-pin="false"] .color-layer {
  opacity: 0 !important;
  border: 0 !important;
}

/* Title gradient */
.Tab .title {
  background: linear-gradient(
    90deg,
    var(--tabs-normal-fg) 80%,
    transparent 99%
  );
  -webkit-background-clip: text;
  background-clip: text;
  color: transparent;
}

/* Audio badge */
.Tab .audio {
  color: var(--atom-blue);
}

/* ================= RESPONSIVE ================= */
@media screen and (min-width: 350px) {
  .NavigationBar[data-layout="inline"]
  .main-items
  .nav-item[data-active="false"] {
    display: flex;
  }

  .BottomBar {
    display: flex;
  }

  #root.root {
    --tabs-indent: 14px;
    --tabs-pinned-height: 40px;
    --tabs-pinned-width: calc(
      (100vw - (var(--tabs-margin) * (var(--pinned-tabs-col) + 1)))
      / var(--pinned-tabs-col)
    );
  }

  .Tab .title,
  .Tab .audio {
    opacity: 1 !important;
  }
}

/* ================= ACCESSIBILITY ================= */
.Tab:focus-visible,
.NavigationBar .nav-item:focus-visible {
  outline: 2px solid rgba(255, 255, 255, 0.25);
  outline-offset: 2px;
  border-radius: calc(var(--general-border-radius) + 2px);
}

/* Attention indicator */
.Tab[data-attention="true"] .title::after {
  content: '';
  display: inline-block;
  width: 6px;
  height: 6px;
  margin-left: 6px;
  border-radius: 999px;
  background: #e5c07b;
  box-shadow: 0 0 0 4px rgba(229, 192, 123, 0.25);
}
